testVerifyHeader :: IO ()
testVerifyHeader = do
    let headerCbor = ""
        eta0 = "411148a40d6c2b49dea994da90fcca559418c63ac8fff8e0d708a8799a10f790"
        spk = 129600 :: Word64
        (_, _, _, _, isOk) = verifyHeaderPraos headerCbor spk eta0
        pt = if isOk then "True" else "False"
    Prelude.putStrLn ("testVerifyHeader: " ++ pt)

data Animal = Animal { animalName :: String, hoppingHeight :: [Int] }
            deriving (Generic, Show)

instance Serialise Animal

testVerifyBlock :: IO ()
testVerifyBlock = do
    let str = ""
        verifyOutput = verifyBlock str
        pt = if (isValid verifyOutput) then "True" else "False"
        seVal = Text.unpack (Text.decodeLatin1 (BL.toStrict (B16L.encode (serialise verifyOutput))))
    traceShow (verifyOutput) pure()


