testB32 :: IO ()
testB32 = do
    let Right prefix = humanReadablePartFromText "pool" 
        messageToEncode = "63f6288de1b069964b7a563cc1b7405455e98dd4e5ef03a7290416f2"
        Right msgBytes = B16.decode messageToEncode
        dataPart = dataPartFromBytes msgBytes
        x = Codec.Binary.Bech32.encode prefix dataPart
    traceShow (typeOf x) (Prelude.putStrLn ("testVerifyHeader: "))

